import * as React from 'react';
import { View, Button, Text } from 'react-native';
import { NavigationContainer, TabActions } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Main from './module/Main.js';

function HomeScreen({ navigation }) {
  const jumpToAction = TabActions.jumpTo('Profile', { user: 'Satya' });

  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Main></Main>
      <Text>Home!</Text>
      <Button
        title="Jump to Profile"
        onPress={() => navigation.dispatch(jumpToAction)}
      />
    </View>
  );
}

function ProfileScreen({ route }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Profile!</Text>
      <Text>{route?.params?.user ? route.params.user : 'Noone'}'s profile</Text>
    </View>
  );
}

const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Camera" component={HomeScreen} />
        <Tab.Screen name="Scanner" component={ProfileScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Camera" component={HomeScreen} />
        <Tab.Screen name="Scanner" component={ProfileScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
